import React from "react"
import $ from "jquery"

import Filmovi from "./Filmovi"
import NoviFilm from "./NoviFilm"
import Users from "./Users"
import Registracija from "./Registracija"

function Main(props){

    const noviFilm=props.state.NoviFilm === true && <NoviFilm />
    const users=props.state.Users === true && <Users />
    return(
        <div id="main">
            <Filmovi />
            {noviFilm}
            {users}
            <Registracija/>
        </div>
    )

    $('#NoviFilm').hide()
}

export default Main
